--
-- Table structure for table `cn_county`
--

DROP TABLE IF EXISTS `cn_county`;

CREATE TABLE `cn_county` (
  `code` char(6) NOT NULL COMMENT '县级行政区划代码 See  http://www.stats.gov.cn/tjsj/tjbz/xzqhdm/201504/t20150415_712722.html',
  `pcode` char(4) NOT NULL COMMENT '所在cn_city的code',
  `name` varchar(8) NOT NULL COMMENT '行政区名称（不含单位）',
  `suffix` varchar(16) NOT NULL COMMENT '行政单位',
  `fullname` varchar(16) NOT NULL COMMENT '全名',
  `pinyin` varchar(32) NOT NULL COMMENT '列name的键盘拼音序列。如北京:beijing',
  `py` varchar(8) NOT NULL COMMENT '列pinyin的简拼序列。如beijing:bj',
  PRIMARY KEY (`code`),
  KEY `idx_name` (`name`),
  KEY `idx_pinyin` (`pinyin`),
  KEY `idx_py` (`py`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='县/区';

